public class HunterOfTheTerminalVelociraptor {
    public static void main(String[] args) {
        double gravity = 9.81;
        double velocity = 0;
        
        for (int i = 0; i < gravity; i++) {
            velocity += gravity;
        }
        
        System.out.println ("the terminal velociraptor is located at " + velocity);
        System.out.println ("here is a link to a velociraptor picture: data:image/jpeg;base64,");
    }
}